import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css'; // Import the CSS file

function HomePage() {
  const title = 'SkillBridge: Bridging the Gap to Your Dream Job';
  const subtitle = 'A Web Application Powered by AWS';

  return (
    <div className="home-page">
      <div className="decorative-shape shape-1"></div>
      <div className="decorative-shape shape-2"></div>
      <h1 className="dancing-text">
        {title.split(' ').map((word, index) => (
          <span key={index} style={{ '--index': index }}>{word} </span>
        ))}
      </h1>
      <h2 className="dancing-text">
        {subtitle.split(' ').map((word, index) => (
          <span key={index} style={{ '--index': index }}>{word} </span>
        ))}
      </h2>
      <Link to="/role-selection" className="start-button">Start Analyzing Your Resume</Link>
    </div>
  );
}

export default HomePage;
